/**
 * Iterates the sequence and invokes the given action for each value in the sequence.
 * @template TSource
 * @param {!Iterable<TSource>} source
 * @param {function(TSource, number): void} callback
 * @param {?=} thisArg
 * @return {void}
 */
export declare function forEach<TSource>(source: Iterable<TSource>, callback: (value: TSource, index: number) => void, thisArg?: any): void;
